import React , {useState} from 'react'


import './navbar.scss';

// import {auth} from '../../firbase'

const Navbar = () => {
    const [linkselected, setLink] = useState([1,0,0,0]);
    function changelink(type)
    {
        console.log(type)
       if (type == 0)
            setLink([1,0,0,0]);
        if (type == 1)
            setLink([0,1,0,0]);
        if (type == 2)
            setLink([0,0,1,0]);
        if (type == 3)
            setLink([0,0,0,1]);

    }

  return (
    <div className="navbar-conrtainer">
        <div className="logo">
            <h1>LOGO</h1>
        </div>
        <ul className="pages-list">  
                <li onClick={console.log("dd")}>  <a 
                className= {linkselected[0] == 1  ? "link-active" : ""}
                 href="#">HOME
                 </a></li> 
                <li> <a  onClick={changelink()}
                className= {linkselected[1] == 1  ? "link-active" : ""} 
                href="#" >ABOUT</a>
                </li>
                <li> <a onClick={changelink()}
                className= {linkselected[2] == 1  ? "link-active" : ""}
                href="#">SERVICE
                </a></li>
                <li> <a onClick={changelink()}
                className= {linkselected[3] == 1  ? "link-active" : ""}
                href="#">CONTACT</a>
            </li>
        </ul>
        <ul className="language-select">
            <li> <a>FR</a> </li>
            <li> <a>ENG</a> </li>
        </ul>
    </div>
  );
};


export default Navbar;
